origincountry1 = OriginCountry.new; origincountry1.try(:id=, 1); origincountry1.try(:description=, "Papua New Guinea (PNG; /ˈpæpuə njuː ˈɡɪniː, ˈpɑː-, -pju-/, US /ˈpæpjuə, pɑːˈpuːə/;[9] Tok Pisin: Papua Niugini; Hiri Motu: Papua Niu Gini), officially the Independent State of Papua New Guinea, is an Oceanian country that occupies the eastern half of the island of New Guinea and its offshore islands in Melanesia, a region of the southwestern Pacific Ocean north of Australia. Its capital, located along its southeastern coast, is Port Moresby. The western half of New Guinea forms the Indonesian provinces of Papua and West Papua."); origincountry1.try(:cover_photo_url=, "http://www.remotelands.com/images/citys/130131014.jpg"); origincountry1.try(:name=, "Papua New Guinea"); origincountry1.try(:created_at=, "2016-11-28 19:29:50"); origincountry1.try(:updated_at=, "2016-12-08 21:04:37"); origincountry1.try(:beans_count=, 3); origincountry1.try(:location_latitude=, -6.314992999999999); origincountry1.try(:location_longitude=, 143.95555); origincountry1.try(:location_formatted_address=, "Papua New Guinea"); OriginCountry.import([origincountry1], :validate => false);
