  origincountry2 = OriginCountry.new; origincountry2.try(:id=, 2); origincountry2.try(:description=, "Guatemala (Listeni/ˌɡwɑːtᵻˈmɑːləˌ ɡwæ-ˌ ɡɑː-/ gwah-tə-mah-lə, gwat-ə-mah-lə or gah-tə-mah-lə; Spanish: [gwateˈmala]), officially the Republic of Guatemala (Spanish: República de Guatemala), is a country in Central America bordered by Mexico to the north and west, the Pacific Ocean to the southwest, Belize to the northeast, the Caribbean to the east, Honduras to the east and El Salvador to the southeast. With an estimated population of around 15.8 million, it is the most populous state in Central America. A representative democracy, Guatemala's capital and largest city is Nueva Guatemala de la Asunción, also known as Guatemala City."); origincountry2.try(:cover_photo_url=, "https://cdn.shopify.com/s/files/1/0197/6032/products/guat_coffee-fields-in-the-distance1.jpg?v=1462878547"); origincountry2.try(:name=, "Guatemala"); origincountry2.try(:created_at=, "2016-11-28 19:31:37"); origincountry2.try(:updated_at=, "2016-12-08 21:10:17"); origincountry2.try(:beans_count=, 3); origincountry2.try(:location_latitude=, 15.783471); origincountry2.try(:location_longitude=, -90.23075899999999); origincountry2.try(:location_formatted_address=, "Guatemala"); OriginCountry.import([origincountry2], :validate => false);
