  origincountry3 = OriginCountry.new; origincountry3.try(:id=, 3); origincountry3.try(:description=, "Colombia (/kəˈlʌmbiə/ kə-lum-biə or /kəˈlɒmbiə/ kə-lom-biə; Spanish: [koˈlombja] ( listen)), officially the Republic of Colombia (Spanish: About this sound República de Colombia (help·info)),[Note 1] is a transcontinental country largely situated in the northwest of South America, with territories in Central America. Colombia shares a border to the northwest with Panama, to the east with Venezuela and Brazil, to the south with Ecuador and Peru.[11] It shares its maritime limits with Costa Rica, Nicaragua, Honduras, Jamaica, the Dominican Republic, and Haiti.[12] It is a unitary, constitutional republic comprising thirty-two departments. The territory of what is now Colombia was originally inhabited by indigenous peoples including the Muisca, Quimbaya, and Tairona."); origincountry3.try(:cover_photo_url=, "http://static.guim.co.uk/sys-images/Travel/Pix/pictures/2010/3/10/1268215588083/Coffee-plantation-near-Ar-001.jpg"); origincountry3.try(:name=, "Colombia"); origincountry3.try(:created_at=, "2016-11-28 19:33:06"); origincountry3.try(:updated_at=, "2016-12-08 21:10:27"); origincountry3.try(:beans_count=, 2); origincountry3.try(:location_latitude=, 4.570868); origincountry3.try(:location_longitude=, -74.297333); origincountry3.try(:location_formatted_address=, "Colombia"); OriginCountry.import([origincountry3], :validate => false);
