  origincountry4 = OriginCountry.new; origincountry4.try(:id=, 4); origincountry4.try(:description=, "Brazil (Listeni/brəˈzɪl/; Portuguese: Brasil [bɾaˈziw][10]), officially the Federative Republic of Brazil (Portuguese: República Federativa do Brasil, About this sound listen (help·info)[11]), is the largest country in both South America and Latin America. As the world's fifth-largest country by both area and population, it is the largest country to have Portuguese as an official language and the only one in the Americas.[12][13] Bounded by the Atlantic Ocean on the east, Brazil has a coastline of 7,491 km (4,655 mi).[14] It borders all other South American countries except Ecuador and Chile and covers 47.3% of the continent's land area.[15] Its Amazon River basin includes a vast tropical forest, home to diverse wildlife, a variety of ecological systems, and extensive natural resources spanning numerous protected habitats.[14] This unique environmental heritage makes Brazil one of 17 megadiverse countries, and is the subject of significant global interest and debate regarding deforestation and environmental protection."); origincountry4.try(:cover_photo_url=, "https://az616578.vo.msecnd.net/files/responsive/embedded/any/desktop/2016/02/14/635910744608299251-278970004_coffee-plantations-brazil.jpg"); origincountry4.try(:name=, "Brazil"); origincountry4.try(:created_at=, "2016-11-28 23:20:05"); origincountry4.try(:updated_at=, "2016-12-08 21:10:34"); origincountry4.try(:beans_count=, 2); origincountry4.try(:location_latitude=, -14.235004); origincountry4.try(:location_longitude=, -51.92528); origincountry4.try(:location_formatted_address=, "Brazil"); OriginCountry.import([origincountry4], :validate => false);
