  origincountry6 = OriginCountry.new; origincountry6.try(:id=, 6); origincountry6.try(:description=, "El Salvador (Listeni/ɛl ˈsælvədɔːr/; Spanish: [el salβaˈðor]), officially the Republic of El Salvador (Spanish: República de El Salvador, literally \"Republic of The Savior\"), is the smallest and the most densely populated country in Central America. El Salvador's capital and largest city is San Salvador. As of 2015, the country had a population of approximately 6.38 million, consisting largely of Mestizos of European and Indigenous American descent.[7]"); origincountry6.try(:cover_photo_url=, "https://locavoredelmundo.files.wordpress.com/2010/11/coffee-red.jpg"); origincountry6.try(:name=, "El Salvador"); origincountry6.try(:created_at=, "2016-12-02 18:36:50"); origincountry6.try(:updated_at=, "2016-12-08 21:10:46"); origincountry6.try(:beans_count=, 2); origincountry6.try(:location_latitude=, 13.794185); origincountry6.try(:location_longitude=, -88.89653); origincountry6.try(:location_formatted_address=, "El Salvador"); OriginCountry.import([origincountry6], :validate => false);
